contracts/Helloworld.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title Helloworld
 * @dev A simple smart contract that stores and emits a greeting message.
 * @custom:dev-run-script ./scripts/deploy_with_ethers.ts
 */
contract Helloworld {
    // State variable to store the greeting message
    string public SayHello = "Hello World!";

    // Event emitted when the greeting message is printed
    event Print(string message);

    /**
     * @dev Constructor function to initialize the contract with a default greeting message.
     */
    constructor() {
        emit Print(SayHello);
    }

    /**
     * @dev Function to get the current greeting message.
     * @return The current greeting message.
     */
    function getGreeting() external view returns (string memory) {
        return SayHello;
    }

    /**
     * @dev Function to set a new greeting message.
     * @param newGreeting The new greeting message.
     */
    function setGreeting(string calldata newGreeting) external {
        SayHello = newGreeting;
        emit Print(SayHello);
    }
}

/**
 * @dev This is the end of the Helloworld contract.
 */

